import { ReactComponent as BootstrapIcon } from "./bootstrap.svg";
import { ReactComponent as CssIcon } from "./css3.svg";
import { ReactComponent as EnIcon } from "./en.svg";
import { ReactComponent as FigmaIcon } from "./figma.svg";

import { ReactComponent as GitIcon } from "./git.svg";
import { ReactComponent as HTMLIcon } from "./html5.svg";
import { ReactComponent as JsIcon } from "./js.svg";
import { ReactComponent as ReactJsIcon } from "./reactjs.svg";
import { ReactComponent as ResearchIcon } from "./research.svg";
import { ReactComponent as SassIcon } from "./sass.svg";
import { ReactComponent as TSIcon } from "./ts.svg";
export const Logo = {
  BootstrapIcon,
  CssIcon,
  EnIcon,
  FigmaIcon,
  GitIcon,
  HTMLIcon,
  JsIcon,
  ReactJsIcon,
  ResearchIcon,
  SassIcon,
};
